DROP TABLE IF EXISTS `jz_suborder`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `jz_suborder` (
  `order_id` bigint(20) NOT NULL COMMENT '服务地址',
  `address_id` int(11) NOT NULL COMMENT '地址',
  `date` date NOT NULL,
  `from_time` time NOT NULL COMMENT '开始时间',
  `to_time` time NOT NULL COMMENT '结束时间',
  `quantity` int(11) NOT NULL COMMENT '需人数',
  `got_qunatity` int(11) NOT NULL DEFAULT '0' COMMENT '已有人数',
  `modified_by` int(11) NOT NULL COMMENT '修改人',
  `pm_id` int(11) NOT NULL DEFAULT '0' COMMENT '项目经理',
  PRIMARY KEY (`order_id`,`address_id`),
  KEY `fk_jz_offline_orders_has_jz_addresses_jz_addresses1_idx` (`address_id`),
  KEY `fk_jz_offline_orders_has_jz_addresses_jz_offline_orders1_idx` (`order_id`),
  KEY `fk_jz_orders_has_schedules_jz_user1_idx` (`modified_by`),
  KEY `fk_jz_suborder_jz_user1_idx` (`pm_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
