--
-- Table structure for table `jz_task`
--

DROP TABLE IF EXISTS `jz_task`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `jz_task` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '标题',
  `clearance_period` smallint(6) DEFAULT NULL COMMENT '结算方式',
  `salary` decimal(10,2) NOT NULL COMMENT '薪资',
  `salary_unit` smallint(6) NOT NULL COMMENT '薪资单位',
  `salary_note` text CHARACTER SET utf8 COMMENT '薪资说明',
  `from_date` date NOT NULL COMMENT '开始日期',
  `to_date` date NOT NULL COMMENT '结束日期',
  `from_time` time DEFAULT NULL COMMENT '上班时间',
  `to_time` time DEFAULT NULL COMMENT '下班时间',
  `need_quantity` int(11) NOT NULL,
  `got_quantity` int(11) NOT NULL DEFAULT '0',
  `created_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `detail` text CHARACTER SET utf8 NOT NULL COMMENT '工作内容',
  `requirement` text CHARACTER SET utf8 COMMENT '其他要求',
  `user_id` int(11) NOT NULL COMMENT '发布人',
  `service_type_id` int(11) NOT NULL COMMENT '服务类型',
  `gender_requirement` smallint(6) DEFAULT NULL COMMENT '性别',
  `degree_requirement` smallint(6) DEFAULT NULL COMMENT '学历',
