\r\n8.请问怎么才能面试？\r\n答：因不常在线，如有意向的同学可直接拨打电话直接预约面试时间即可，鸽子勿扰！\r\n以上是大概统计出的各位同学的问题，真诚面试兼职的朋友可直接拨打电话预约面试时间，鸽子勿扰！（请由每日的工作时间拨打电话，谢谢理解）','',10,13,NULL,NULL,NULL,NULL,0,3,'143409800464010',6,0,'北京市北京朝阳东三环中路18号东环国际大厦5层贝乐学科英语','北京倍乐优学教育咨询有限公司',NULL,'李先生','15011155018'),(119,'银行系统运维实习生',0,7000.00,3,'特别备注一：\r\n通过面试者即签订上岗合同，进行岗前培训。培训时间3.5个月。培训期间不需要实际支付任何费用。岗前培训费用由银行和金融机构提供，正式工作后分期偿还。培训结束和用人单位签定正式工作合同，立即入职上岗。\r\n特别备注二：\r\n根据个人能力定岗定薪。\r\n    第一年工资6000元/月-10000元/月  \r\n    第二年起8000元/月-16000元/月      \r\n    均享受国家规定的五险一金福利待遇。','2015-06-12','2015-07-29',NULL,NULL,30,0,'2015-06-12 08:42:07',NULL,'银行联合招聘系统运维工程师/实习生/网络信息管员/系统架构/通信技术等\r\n受北京各大银行、金融机构、高新技术上市公司等的委托紧急招聘：系统运维工程师及实习生36名。\r\nAIX系统工程师是银行、金融机构高级it岗位；发展前景大，工作年限越长，工资涨得越高，本次招聘机会难得，计划不多；实习生可以零基础！选择比努力更重要！机会就在眼前，投个简历吧！\r\n1、招聘范围：全国。\r\n2、岗位：系统运营维护实习生、aix系统工程师（36人）\r\n3、报名条件：\r\n    应、往届大专以上学历（统招类）理工类毕业生、如：计算机、网络、软件工程师、电子技术、电子商务、自动化、应用数学等相关专业均可报名。\r\n4、报名时间：即日起\r\n5、面试时间：电话通知\r\n6、面试地点：北京（以面试通知书为主）\r\n7、工作地点：北京市区范围内各大银行、金融机构及高新企业上市公司','',10,6,NULL,NULL,NULL,NULL,0,3,'143409852748510',5,0,'北京市北京西城','北京中关新才科技有限公司',NULL,'焦先生','13321173179'),(120,'京东捡货员',0,110.00,1,'','2015-06-12','2015-07-01',NULL,NULL,39,0,'2015-06-12 08:53:15',NULL,'具体内容:\r\n详细地址：海淀上庄京东库房\r\n工作要求：京东商城急聘分拣理货员：最少做一周男士优先\r\n早班：am10：00-pm21:00  需求50人，\r\n晚班：pm21：00-am 7:00   需求50人，\r\n工作周期：6月8日-7月1日\r\n实际工作8小时左右，因为下午2点-5点左右基本上是属于适当休息，\r\n工资待遇：110元一天，日结，\r\n工作地点：海淀上庄','',10,5,NULL,NULL,NULL,NULL,0,3,'143409919595210',9,0,'北京市海淀上庄京东库房','广茂科技有限公司',NULL,'马先生','15011038633'),(121,'至本教育招聘在校大学生咨询顾问待遇丰厚',0,60.00,0,'具体报酬：1.咨询顾问每完成一次咨询，根据通话时长进行提成，每分钟1元。2.咨询顾问每推荐一个学生成为我们的咨询顾问，我们将按照新增咨询顾问获得咨询收入的10%-20%作为推荐报酬。','2015-06-12','2015-07-31',NULL,NULL,30,0,'2015-06-12 08:59:27',NULL,'家长和学生进入在我公司网站、手机APP端可以就自己感兴趣的大学和专业向相应的咨询顾问进行电话咨询，我公司以咨询时长为依据进行收费，并按提成比例做为作为校园代理的代理报酬。工作内容:在我公司网站和APP上进行注册，向高三学生提供咨询服务； 不管你是在路上，在餐厅，在马桶上只要手机有电，拨通电话就有丰厚收入。','',10,14,NULL,NULL,NULL,NULL,0,3,'143409956732810',9,0,'北京市北京海淀地点不限，时间灵活','广州至本教育科技有限公司',NULL,'赵老师','18620943578'),(122,'聚美优品早餐活动地推人员',2,25.00,0,'','2015-06-12'