和分享等多功能体验。\r\n    在2014双11网购节，The ONE智能钢琴成为全网乐器品类销量冠军，是2-20名销量的总和。日前，The ONE更入选了2014年度互联网产品50强的最受关注硬件、年度创新产品、年度创业新星三个奖项。','2015-06-13','2015-11-26',NULL,NULL,1,0,'2015-06-13 09:07:39',NULL,'1、负责各招聘渠道（如招聘网站、论坛等）的职位发布、更新及维护；\r\n2、简历筛选，意向沟通，电话约面，面试安排与接待等工作；  \r\n3、招聘相关数据统计与分析；\r\n4、临时安排的其他行政人事工作。\r\n希望你是：\r\n1、热爱互联网行业，大二、大三本科生或研一、研二学生，有招聘实习经验优先；\r\n2、能熟练操作办公软件，具备一定的文字写作功底；  \r\n3、工作态度积极，能承受压力，沟通能力强，做事高效有条理性；\r\n4、每周工作时间要保证至少4个整天，且实习时间持续工作4个月以上。\r\n我们为你提供：\r\n1、了解并体验一家活力、创新有前景的创业型互联网公司工作氛围；\r\n2、120-150元/天，免费的健康午餐、晚餐、水果（PP阿姨做的饭绝对秒杀一切学校饭堂~）\r\n3、实习收获工作经验之余，让你更增文艺气息，学会弹奏钢琴哦\r\n3、每周五的下午茶Hi-tea时光，隔周五的专业师傅推拿按摩\r\n4、工作时间：周一至周五，弹性上班制\r\n5、公司坐标：望京SOHO T1C座 10层 \r\n简历请投至liuyin.intern@xiaoyezi.com','',10,4,NULL,NULL,NULL,NULL,0,3,'143418645910310',6,0,'北京市北京朝阳','The ONE智能钢琴',NULL,'周小姐','010-64750910'),(148,'esprit总部招募大三实习生',0,120.00,1,'','2015-06-13','2015-07-30','09:00:00','17:03:00',3,0,'2015-06-13 09:21:51',NULL,'北京esprit总部招募实习生，要求在校大学生                                                                                                                                    \r\n工作地址：朝阳区四惠东四惠大厦（地铁1号线四惠东站B出口）  HR招募助理一人，北京本地学生和在北京上学的外地生均可。 只要大三学生，暑假不回家者优先\r\n工作时间：每周一至周五有两天可来公司实习即可，9：00-17：30 \r\n到岗时间:即日面试，通过立即上岗                                                                                                                                                   \r\n待遇：HR助理120元/天                                                                                                                                            \r\n报名方式：加微信号即手机号','',10,4,NULL,NULL,NULL,NULL,0,3,'143418731128910',6,0,'北京市北京朝阳','上海久耀市场营销有限公司',NULL,'蒋小姐','18017370407'),(149,'ZARA招兼职导购-暑期工',0,18.00,0,'','2015-06-15','2015-08-31',NULL,NULL,50,0,'2015-06-15 03:14:33',NULL,'ZARA招聘暑期兼职导购~\r\n男女不限~无其他要求~\r\n薪资待遇：18块/小时~\r\n地点：蓝色港湾，世贸天阶，朝阳大悦城，双井，悠唐生活广场，东直门来福士和未来广场。\r\n不累又钱多~快来报名吧！（6.15、6.16、6.17三天面试，面试合格即可上岗！）','',10,5,NULL,NULL,NULL,NULL,0,3,'143433807361210',6,0,'蓝色港湾，世贸天阶，朝阳大悦城，双井，悠唐生活广场，东直门,','鑫众联合企业管理有限公司',NULL,'贾女士','1381122895