','010-82665230'),(167,'北京第二外国语学院暑假招兼职',0,100.00,1,'','2015-06-20','2015-08-25',NULL,NULL,20,0,'2015-06-16 08:43:27',NULL,'工作时间：2015-06-20-2015-08-25\r\n岗位职责：\r\n1、咨询电话的接听，做好相应的信息记录；\r\n2、爱岗敬业、完成其他临时性工作。\r\n任职资格：\r\n1、年龄22到30岁，专科以上学历；\r\n2、普通话标准，有亲和力、幽默感，沟通能力强；\r\n3、有团队合作精神和敬业精神，执行力好，抗压能力强，富有责任心。\r\n工作时间：每天工作8小时，工作待遇好、环境好（二外校园内），底薪高，奖金高。欢迎大学生暑假兼职','',10,16,NULL,NULL,NULL,NULL,0,3,'143444420796510',6,0,'定福庄南里北京第二外国语学院','北京托普赛斯投资管理有限公司',NULL,' 张老师','010-58407980'),(168,'密室逃脱体验馆',0,120.00,1,'','2015-06-16','2015-08-31',NULL,NULL,3,0,'2015-06-16 08:53:33',NULL,'岗位要求：\r\n1. 对推理解谜等游戏感兴趣，需要细心且有耐心与玩家交流，有较强的服务意识，乐于为玩家服务。 \r\n2. 外表状态：端庄大方、fashion、活泼靓丽、正能量爆棚，如果你有以上中的任何一项即可前来面试。 \r\n3. 工作态度：需工作认真的态度且强烈的责任心，遵守公司各项规章制度，以饱满的精神面貌向顾客提供准确、快捷、热情的服务！ \r\n4. 工作能力：要求有很强的沟通能力，服务意识和亲和力。\r\n具体内容：1、游戏流程控制与引导，玩家接待，游戏咨询答复，引导他们参与游戏,要求热情、礼貌、耐心、周到。 \r\n2、了解游戏整个解密过程，准确有效的在玩家需要时给予提示。\r\n3、熟悉本岗位职责和日常工作情况，了解密室逃脱等知识，能够为顾客提供规范化，标准化服务。\r\n4、协助店长完成预约工作，接听客户预约电话。\r\n5、积极参加各项培训，不断提高服务技能。','',10,16,NULL,NULL,NULL,NULL,0,3,'143444481366110',5,0,'德胜门内大街','北京弗洛文化发展有限公司',NULL,'张默非','15711025089'),(169,'美丽来招聘暑期实习生10名',0,120.00,1,'','2015-06-16','2015-06-30',NULL,NULL,10,0,'2015-06-16 10:59:20',NULL,'职位描述：\r\n1.通过地面市场推广活动在指定范围的区域、向消费者进行公司互联网产品推广；\r\n2.了解、分析、收集和反馈市场推广情况；\r\n3.负责配合上级完成线下活动的前期准备、活动过程执行以及活动收尾、数据汇总等工作；\r\n4.完成上级安排的其他工作。\r\n\r\n职位要求：\r\n1.大学在校生或中文、新闻、人力资源专业应届毕业生，文笔好，对互联网行业感兴趣。\r\n2.具备较强的综合能力，擅长与陌生人交流沟通；\r\n3.认真负责，吃苦耐劳，对工作有激情，有上进心；\r\n5.保证周一至周五至少三天上班。\r\n\r\n兼职时间或周期：\r\n实习生待遇：80/100/120每天\r\n可接受长期兼职，表现突出在毕业后可转正为正式员工。','',2369,4,NULL,NULL,NULL,NULL,0,3,'14344523606052369',9,0,'成府路五道口优盛大厦D座1103室','北京美丽来佳人网络技术有限公司',NULL,'彭琳','18801406826'),(170,'摄影助理',0,150.00,1,'','2015-06-17','2015-08-31',NULL,NULL,5,0,'2015-06-17 04:04:31',NULL,'岗位要求：要求 男孩 工作时间 周末以及法定节假日。 能长期工作的   需要大一或者刚升大二的学生。 工作地点在通州附近。   \r\n\r\n具体内容：协助摄影师拍摄宣传片，纪录片等商业视频。 管午餐。早九晚六 一天100-150元。 不会的可以学习摄影技巧，对于喜欢摄影的同学有帮助。','',10,16,NULL,NULL,NULL,NULL,0,3,'143451387184110',12,0,'通州附近','北京互动创源营销策划有限公司',NULL,'王老师','18600383979');
